import "./App.css";

const data = [
  {
    b: "Smells Bad",
    i: "Slow Service",
    n: "Rude Employees",
    g: "Not Queer Friendly",
    o: "Uncomfy Seating",
  },
  {
    b: "Long Wait",
    i: "Noise Level",
    n: "Overpriced",
    g: "Far Away",
    o: "Parking Fee",
  },
  {
    b: "Cold Food",
    i: "Made by Chef Mike",
    n: "FREE SPACE",
    g: "Climate",
    o: "Outdated Decor",
  },
  {
    b: "Dirty Seats",
    i: "Sticky Surfaces",
    n: "Trashy Patrons",
    g: "American Flag",
    o: ".",
  },
  { b: 1, i: 2, n: 3, g: 4, o: 5 },
];

function App() {
  return (
    <div className="App">
      <table>
        <tr>
          <th>B</th>
          <th>I</th>
          <th>N</th>
          <th>G</th>
          <th>O</th>
        </tr>
        {data.map((val, key) => {
          return (
            <tr key={key}>
              <td>{val.b}</td>
              <td>{val.i}</td>
              <td>{val.n}</td>
              <td>{val.g}</td>
              <td>{val.o}</td>
            </tr>
          );
        })}
      </table>
    </div>
  );
}

export default App;
